        return new Source("{% extends 'base.html.twig' %}

{% block title %}Task index{% endblock %}

{% block body %}
    <h1>Task index</h1>

    <table class=\"table\">
        <thead>
            <tr>
                <th>Id</th>
                <th>Title</th>
                <th>Description</th>
                <th>CreatedAt</th>
                <th>CompletedAt</th>
                <th>Priority</th>
                <th>User_id</th>
                <th>Parent_id</th>
                <th>Status</th>
                <th>actions</th>
            </tr>
        </thead>
        <tbody>
        {% for task in tasks %}
            <tr>
                <td>{{ task.id }}</td>
                <td>{{ task.title }}</td>
                <td>{{ task.description }}</td>
                <td>{{ task.createdAt ? task.createdAt|date('Y-m-d H:i:s') : '' }}</td>
                <td>{{ task.completedAt ? task.completedAt|date('Y-m-d H:i:s') : '' }}</td>
                <td>{{ task.priority }}</td>
                <td>{{ task.userId }}</td>
                <td>{{ task.parentId }}</td>
                <td>{{ task.status }}</td>
                <td>
                    <a href=\"{{ path('app_task_show', {'id': task.id}) }}\">show</a>
                    <a href=\"{{ path('app_task_edit', {'id': task.id}) }}\">edit</a>
                </td>
            </tr>
        {% else %}
            <tr>
                <td colspan=\"10\">no records found</td>
            </tr>
        {% endfor %}
        </tbody>
    </table>

    <a href=\"{{ path('app_task_new') }}\">Create new</a>
{% endblock %}
